import React from 'react';


class MainVideo extends React.Component {


   render () {
    console.log(this.props.mainVideo)
     return (
      <>
         <video poster={this.props.mainVideo.image} src={this.props.mainVideo.video}></video> 
     </>
     )
   }
}




export default MainVideo;
